import React from "react";
import Header from "./Header/Header";
import GeneralInfo from "./General-info-section/GeneralInfo";
import Footer from "./Footer/Footer";
import OrdersInfo from "./Orders-info/OrdersInfo";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Orders from "../stores/Orders";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route
          path="/"
          element={
            <main>
              <GeneralInfo />
              <OrdersInfo />
            </main>
          }
        />
        <Route path="/contact" element={<OrdersInfo />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
